import React, { useState, useEffect } from "react";
import { useLocation, useParams,useNavigate, Navigate, createSearchParams } from "react-router-dom";
import axios from "axios";
import Header from "../layouts/Header";



function UpdatedPatientProfile(props)
{
    let { dentistId } = useParams(); 
   
    const navigate = useNavigate();
    const location = useLocation();
    const ssn = new URLSearchParams(location.search).get('ssn'); //console.log(ssn);

    const [patient, setPatient] = useState({

        name: "",
        surname: "", 
        ssn: ssn,
        birthdate: "",
        email: "",
        telephone: "",
        address: "",
        gender: "",
        dentist_id: dentistId
    });
  


    useEffect(() => {
        loadPatient();
      }, []);


    const loadPatient = async () => {
        const result = await axios.get(`http://localhost:8080/patients/getPatient/${ssn}`);
        setPatient(result.data);
    };

    const handleChange = (event) => {
        setPatient({ ...patient, [event.target.name]: event.target.value });
    };

    const handleSubmit  = async (event) => {
        event.preventDefault();
        await axios.put(`http://localhost:8080/patients/updatePatient/${ssn}?dentistId=${dentistId}`, patient);
        navigate(`/dentistpage/${dentistId}`);
    };
    
    const handleCancel = async(event) =>{
      event.preventDefault();
      navigate(`/dentistpage/${dentistId}`);
    }

    return <div>

        <Header title= {"ToothHub"}/>
        <div className="centered-container">
        <div style={{height:"100%", marginTop:"2%", backgroundColor:"#8DDFCB", borderRadius: "25px", padding:"10px 30px"}}>
        <form onSubmit={handleSubmit} style={{float:"left", paddingLeft:"15px", color:"black"}}>
            <label for="fname" style={{color:"white"}}>First name:</label><br/>
            <input type="text"  name="name" onChange= {handleChange} value={patient.name} />
            <br/>   
            <br/>
            <br/>
            <label for="lname" style={{color:"white"}}>Last name:</label><br/>
            <input type="text"  name="surname" onChange= {handleChange} value={patient.surname} />
            <br/>   
            <br/>
            <br/>
            <label for="birthdate" style={{color:"white"}}>Birthdate:</label><br/>
            <input type="date"  name="birthdate" onChange= {handleChange} value={patient.birthdate} />
            <br/>   
            <br/>
            <br/>
            <label for="gender" style={{color:"white", padding: "5px 5px"}}>Choose gender: </label> 
                <select name="gender" id="gender" onChange= {handleChange} style={{ borderRadius: "25px", margin:"10px 10px"}} value={patient.gender}> 
                    <option name= "gender" value={"Male"} >Male</option> 
                    <option name="gender" value={"Female"} >Female</option> 
                    
                </select>
            <br/>   
            <br/>
            <br/>
            <label for="email" style={{color:"white"}}>Email:</label><br/>
            <input type="text"  name="email" onChange= {handleChange} value={patient.email} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="telephone" style={{color:"white"}}>Telephone:</label><br/>
            <input type="text"  name="telephone" onChange= {handleChange} value={patient.telephone} />
            <br/>   
            <br/>
            <br/>
            <label for="address" style={{color:"white"}}>Address:</label><br/>
            <input type="text"  name="address" onChange= {handleChange} value={patient.address}/>
            <br/>   
            <br/>
            <br/>
            <button type="submit" className="btn btn-outline-primary">
              Submit
            </button>
            <button className="btn btn-outline-danger mx-2" onClick={handleCancel}>
              Cancel
            </button>
          </form>
      </div>
    </div>

    </div>

}


export default UpdatedPatientProfile;
